import React from "react";
import '../App.css';
import $ from 'jquery';
export default function Home(){
    
$(document).ready(function() {
    $('.countdown').final_countdown({
    start: '1362139200',
    end: '1388461320',
    now: '1387461319',
    selectors: {
        value_seconds: '.clock-seconds .val',
        canvas_seconds: 'canvas_seconds',
        value_minutes: '.clock-minutes .val',
        canvas_minutes: 'canvas_minutes',
        value_hours: '.clock-hours .val',
        canvas_hours: 'canvas_hours',
        value_days: '.clock-days .val',
        canvas_days: 'canvas_days'
    },
    seconds: {
        borderColor: '#7995D5',
        borderWidth: '6'
    },
    minutes: {
        borderColor: '#ACC742',
        borderWidth: '6'
    },
    hours: {
        borderColor: '#ECEFCB',
        borderWidth: '6'
    },
    days: {
        borderColor: '#FF9900',
        borderWidth: '6'
    }}, function() {
    // Finish callback
    });
    });


return (
    <div>
    <h1 style={{color:'white', fontFamily:'Arial'}}>HOLA MOZILLA 2.0</h1>
    <div style={{color:'white', fontFamily:'Arial'}}><span>21</span> <span>st</span> <span>December at 7.00 pm</span></div>
    <h2>Let jQuery AJAX Change This Text</h2>
    
    <button>Get External Content</button>
    </div>
)
}
